// frontend/src/components/CourseList.js
import React, { useEffect, useState } from 'react';
import { getCoreCourses } from '../services/courseService';

const CourseList = () => {
    const [courses, setCourses] = useState([]);

    useEffect(() => {
        const fetchCourses = async () => {
            const data = await getCoreCourses();
            setCourses(data);
        };
        fetchCourses();
    }, []);

    return (
        <div>
            <h2>Core Courses</h2>
            <ul>
                {courses.map((course) => (
                    <li key={course.id}>
                        {course.name} - {course.credits} credits
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default CourseList;
